import React from 'react';
import { useExpense } from '../context/ExpenseContext';

const Transactions = () => {
  const { transactions } = useExpense();

  return (
    <div>
      <h2 className="text-2xl font-semibold text-gray-900">Transactions</h2>
      <div className="mt-4 overflow-x-auto">
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Date</th>
              <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Description</th>
              <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Category</th>
              <th className="px-4 py-2 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">Amount</th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            {transactions.map((t) => (
              <tr key={t.id}>
                <td className="px-4 py-2 whitespace-nowrap">{t.date}</td>
                <td className="px-4 py-2 whitespace-nowrap">{t.description}</td>
                <td className="px-4 py-2 whitespace-nowrap">{t.category}</td>
                <td className="px-4 py-2 whitespace-nowrap">${t.amount?.toFixed ? t.amount.toFixed(2) : t.amount}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Transactions;
